      <div className="App">
        <AuthenticatedTemplate>
          {time}
        <h1>Alt her:</h1>
          <GetUsers />
        </AuthenticatedTemplate>
        <UnauthenticatedTemplate>
          <ReqUsers/>
        </UnauthenticatedTemplate>
      </div>
    );
}

export default App;
